import React from 'react'
import '../styles/AboutUs.scss'

function AboutUs() {
    return(
        <section className="aboutus-section" id="about">
            <h1 className="about-us-title">ABOUT US</h1>
            <p className="about-us-description">
            Our family created with passion Nature Sculpt <span className="highlighted-text">twenty years ago</span>. Our passion for plants and trees made us 
            decide to share our 
            knowledge and skills with the public. Our team is composed of a <span className="highlighted-text">landscaping architect</span>, an agronomist, an <span className="highlighted-text">irrigation expert</span>, a garden maintenance specialist, 
            a team of experienced gardeners and an administrative service.
            </p>
        </section>
    );
}

export default AboutUs
